import './App.css';
import { useEffect, useState } from 'react';

function App() {

  const [todos, setTodos] = useState([]);

  useEffect(() => {
    // fetch returns a promise
    fetch('https://dummyjson.com/todos/user/5')
      .then((res) => res.json())
      .then((data) => setTodos(data.todos))
  }, [])

  console.log('todos', todos);

  return (
    <section>
      <header>
        <h1>Todos</h1>
      </header>
    </section>
  );
}

export default App;
